def transform(sequence):
    start_zero_index = 0
    end_zero_index = len(sequence) - 1

    for i in range(len(sequence)):
        if sequence[i] != '0':
            break
        start_zero_index += 1

    for i in range(len(sequence) - 1, -1, -1):
        if sequence[i] != '0':
            break
        end_zero_index -= 1

    transformed_sequence = sequence[:start_zero_index] + '0' * (end_zero_index - start_zero_index + 1) + sequence[end_zero_index + 1:]

    return transformed_sequence
